  const fn = descriptor.value;
  const thefunction = async () => console.log("thing"); 

  //console.log(isAsyncFunction(thefunction)); // true
  console.log(isAsyncFunction(fn)); // true

  descriptor.value = async function(args) {
    try {
      console.log("works")
      const result = await fn.call(this, args);
      console.log(result)
      return result;
    } catch (error) {
    //  console.log(error)
      console.log('3')
    }
  }

  return descriptor;

  return {
    async value(args) {
      try {
        console.log("works")
        return await fn.call(this, args);
      } catch (error) {
      //  console.log(error)
        console.log('3')
      }
    }
  };

};

